patch:
diff --git a/src/change.c b/src/change.c
index daf4faed5..0f377dfd9 100644
--- a/src/change.c
+++ b/src/change.c
@@ -1118,13 +1118,22 @@ ins_char_bytes(char_u *buf, int charlen)
 	}
     }

-    newp = alloc(linelen + newlen - oldlen);
+    int needed = col + newlen;
+    int base_alloc = linelen + newlen - oldlen;
+    int allocated = (base_alloc > needed) ? base_alloc : needed;
+    newp = alloc(allocated + 1); // +1 for NUL terminator
     if (newp == NULL)
-	return;
-
-    // Copy bytes before the cursor.
-    if (col > 0)
-	mch_memmove(newp, oldp, (size_t)col);
+        return;
+
+    // Copy bytes before the cursor (or pad with spaces if col > linelen)
+    if (col > linelen) {
+        if (linelen > 0)
+            mch_memmove(newp, oldp, (size_t)linelen);
+        for (int j = linelen; j < col; ++j)
+            newp[j] = ' ';
+    } else if (col > 0) {
+        mch_memmove(newp, oldp, (size_t)col);
+    }

     // Copy bytes after the changed character(s).
     p = newp + col;
@@ -1140,6 +1149,9 @@ ins_char_bytes(char_u *buf, int charlen)
     while (i < newlen)
 	p[i++] = ' ';

+    // Ensure NUL termination at end of new line
+    newp[allocated] = NUL;
+
     // Replace the line in the buffer.
     ml_replace(lnum, newp, FALSE);
